import * as React from 'react'

/**
 * Muestra la lista de amigos.
 * @param props 
 * @returns 
 */

export default function FriendList(props: any) {
    return (
        <div>
            User name is {props.user.name}
            Friends: {
                props.user.friends.map((friend: any) => {
                   return <li>{friend.name} : {friend.status}</li>
                })
            }
        </div>
    )
}
